import React from "react";
import "./style.css";

function Contact(props) {
  return (
    <div class="contact">
      <h1 class="xxlarge">contact me</h1>
      <hr />
      <button class="contactBtns ">
        <span>email</span>
      </button>
      <button class="contactBtns"><span>GitHub</span></button>
      <button class="contactBtns"><span>Resume (PDF)</span></button>
      <button class="contactBtns">
        <span>LinkedIn<i class="fa fa-linkedin"></i></span>
      </button>
    </div>
  );
}

export default Contact;
